from collections import defaultdict

def findItinerary(tickets):
    graph = defaultdict(list)
    for pair in tickets:
        graph[pair[0]].append(pair[1])
    for key in graph:
        graph[key].sort(reverse=True)
    stack = ['']
    itinerary = []
    while stack:
        while graph[stack[-1]]:
            stack.append(graph[stack[-1]].pop())
        itinerary.append(stack.pop())
    return itinerary[::-1]

